import React from 'react';
import { Bar } from 'react-chartjs-2';
const ChartTry = () => {
    // const data = {
    //     labels: ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"],
    //     datasets: [20,30,10,30,50,10,50,12,43,5,12]
    // }
    const data = {
        labels: ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"],
        datasets: [{
            label: ["BCG","DBCG","VAT"],
            data: [[20, 12, 19, 3, 5, 2, 3],[25, 5, 15, 7, 6, 9, 3]],
            backgroundColor: [
                'rgba(255,99,132,0.2)',
                'rgba(54,162,235,0.2)',
                'rgba(255,206,86,0.2)',
                'rgba(75,192,192,0.2)',
                'rgba(153,102,255,0.2)',
                'rgba(255,159,64,0.2)',
            ],
            borderColor:[
                'rgba(255,99,132,1)',
                'rgba(54,162,235,1)',
                'rgba(255,206,86,1)',
                'rgba(75,192,192,1)',
                'rgba(153,102,255,1)',
                'rgba(255,159,64,1)',
            ]
        }]
    };
    return (
        <div className="my-5">
            <Bar data={data} title='Stock status' />
        </div>
    );
}

export default ChartTry;
